description:
Human Highway (Neil Young, DEVO, Dennis Hopper 1982)

Once again, I searched for something on the TPB, and found something that has not been uploaded before. Not sure if anyone would still want to see this movie (maybe thats why i didn't find it), but we will find out!

This is my first movie, and it's a rip from Laser Disc, so it's not perfect.  It looks funny in some parts, but watchable. The LD copy I have of Human Highway is mint.  Played it on a Poineer CLD-V101, dubbed it to a Sony RDR-VX511 DVD Recorder on the highest quality setting, then ripped to the AVI files you see here. There are two AVI files to represent Side 1 and Side 2.  Any suggestions?  Please leave a comment!

